カラー作品No.8を綺麗に仕上げました
以前に投稿した際、色が荒く綺麗ではありませんでした
最近、色の塗り方を変えてタッチペンで細かくやるようにしました。
1枚目の作品が今回、仕上げた作品です
以前の色の荒さも消え、色本来の美しさも出たと思います
まだ色が荒い作品が何点かありますので、少しずつ直していきたいと思います
ただし、1点にかかる時間がどうしてもかかるため、遅れてしまう可能性があります
そこはご了承ください

[Repost] I finished the color work No.8 beautifully When I posted it before, it was not so beautiful because the colors were rough. Recently, I changed the way of painting the color and made it fine with a touch pen. The first piece is the one I finished this time, I think that the roughness of the previous color has disappeared and the original beauty of the color has also appeared, there are still some pieces with rough colors, so I will fix it little by little However, please note that there is a possibility that it will be delayed as it will take one point to complete

カラー作品 No.8
僕の親友からのリクエストで色を塗ってみました
ボクシング好きで、希望はロマチェンコカラーでした！
ロマチェンコはウクライナ🇺🇦出身のボクサーです！
少しでもロマチェンコカラーに近づいていればと思います！

Color work No.8 I painted the color at the request of my best friend. I like boxing, and my hope was Lomachenko color! Lomachenko is a boxer from Ukraine 🇺🇦! I hope I'm getting closer to the Lomachenko color!

